import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { Tabs, Tab, Box, Typography, useMediaQuery, useTheme } from '@mui/material';
import { FiUsers, FiMessageSquare, FiFileText, FiUser, FiMail, FiHome } from 'react-icons/fi';
import UserManagement from './UserManagement';
import AdminMessages from './AdminMessages';
import UserPosts from './UserPosts';
import LoadingSpinner from '../../components/common/LoadingSpinner';

const TabPanel = (props) => {
  const { children, value, index, ...other } = props;
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`admin-tabpanel-${index}`}
      aria-labelledby={`admin-tab-${index}`}
      {...other}
    >
      {value === index && <Box sx={{ p: 3 }}>{children}</Box>}
    </div>
  );
};

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalProperties: 0,
    pendingApprovals: 0,
    activeListings: 0,
  });

  const [recentActivity, setRecentActivity] = useState([]);
  const [loading, setLoading] = useState(true);
  const [tabValue, setTabValue] = useState(0);
  const { user, loading: authLoading } = useAuth();
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  useEffect(() => {
    // Simulate API call
    const fetchDashboardData = async () => {
      try {
        await new Promise(resolve => setTimeout(resolve, 800));
        
        // Mock data
        setStats({
          totalUsers: 1245,
          totalProperties: 856,
          pendingApprovals: 23,
          activeListings: 432,
        });

        setRecentActivity([
          { id: 1, user: 'John Doe', action: 'created a new listing', time: '10 minutes ago', type: 'property' },
          { id: 2, user: 'Jane Smith', action: 'updated profile information', time: '25 minutes ago', type: 'profile' },
          { id: 3, user: 'Mike Johnson', action: 'submitted a property for approval', time: '1 hour ago', type: 'approval' },
          { id: 4, user: 'Sarah Williams', action: 'signed up for an account', time: '2 hours ago', type: 'user' },
          { id: 5, user: 'Alex Brown', action: 'contacted support', time: '3 hours ago', type: 'support' },
        ]);

        setLoading(false);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  useEffect(() => {
    // Redirect if not admin
    if (!authLoading && user?.role !== 'admin') {
      navigate('/');
    } else if (!authLoading) {
      setLoading(false);
    }
  }, [user, authLoading, navigate]);

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const StatCard = ({ title, value, icon: Icon, trend, trendText, link }) => (
    <div className="bg-white rounded-lg shadow p-6">
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm font-medium text-gray-500">{title}</p>
          <p className="text-2xl font-semibold mt-1">{value.toLocaleString()}</p>
          {trend && (
            <p className={`text-sm mt-2 ${trend > 0 ? 'text-green-500' : 'text-red-500'}`}>
              {trend > 0 ? '↑' : '↓'} {Math.abs(trend)}% {trendText}
            </p>
          )}
        </div>
        <div className="p-3 rounded-full bg-blue-50 text-blue-600">
          <Icon className="w-6 h-6" />
        </div>
      </div>
      {link && (
        <Link to={link} className="mt-4 inline-block text-sm text-blue-600 hover:underline">
          View all
        </Link>
      )}
    </div>
  );

  const ActivityItem = ({ activity }) => {
    const getIcon = () => {
      switch (activity.type) {
        case 'property':
          return <Home className="w-4 h-4 text-blue-500" />;
        case 'user':
          return <Users className="w-4 h-4 text-green-500" />;
        case 'approval':
          return <CheckCircle className="w-4 h-4 text-yellow-500" />;
        case 'support':
          return <AlertCircle className="w-4 h-4 text-red-500" />;
        default:
          return <Clock className="w-4 h-4 text-gray-400" />;
      }
    };

    return (
      <div className="flex items-start py-3 border-b border-gray-100 last:border-0">
        <div className="mr-3 mt-0.5">
          <div className="p-1.5 rounded-full bg-gray-50">
            {getIcon()}
          </div>
        </div>
        <div className="flex-1">
          <p className="text-sm">
            <span className="font-medium">{activity.user}</span> {activity.action}
          </p>
          <p className="text-xs text-gray-500 mt-1 flex items-center">
            <Clock className="w-3 h-3 mr-1" />
            {activity.time}
          </p>
        </div>
      </div>
    );
  };

  if (loading || authLoading) {
    return <LoadingSpinner />;
  }

  return (
    <Box sx={{ width: '100%', minHeight: 'calc(100vh - 64px)' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider', bgcolor: 'background.paper' }}>
        <Tabs 
          value={tabValue} 
          onChange={handleTabChange}
          variant={isMobile ? 'scrollable' : 'fullWidth'}
          scrollButtons={isMobile ? 'auto' : false}
          aria-label="admin dashboard tabs"
          sx={{
            '& .MuiTabs-indicator': {
              backgroundColor: theme.palette.primary.main,
              height: 3,
            },
            '& .MuiTab-root': {
              minHeight: 64,
              textTransform: 'none',
              fontWeight: 500,
              '&.Mui-selected': {
                color: theme.palette.primary.main,
              },
            },
          }}
        >
          <Tab 
            icon={<FiUsers size={20} style={{ marginBottom: 4 }} />} 
            label={!isMobile && "Users"} 
            iconPosition="start"
            sx={{ minWidth: isMobile ? 80 : 'auto' }}
          />
          <Tab 
            icon={<FiMessageSquare size={20} style={{ marginBottom: 4 }} />} 
            label={!isMobile && "Messages"} 
            iconPosition="start"
            sx={{ minWidth: isMobile ? 80 : 'auto' }}
          />
          <Tab 
            icon={<FiFileText size={20} style={{ marginBottom: 4 }} />} 
            label={!isMobile && "User Posts"} 
            iconPosition="start"
            sx={{ minWidth: isMobile ? 80 : 'auto' }}
          />
        </Tabs>
      </Box>

      <TabPanel value={tabValue} index={0}>
        <UserManagement />
      </TabPanel>
      <TabPanel value={tabValue} index={1}>
        <AdminMessages />
      </TabPanel>
      <TabPanel value={tabValue} index={2}>
        <UserPosts />
      </TabPanel>

      <div className="container mx-auto p-4 md:p-6">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-2xl font-bold">Admin Dashboard</h1>
          <div className="flex space-x-4">
            <Link
              to="/admin/manage-users"
              className="flex items-center px-4 py-2 bg-blue-600 text-white rounded-md hover:bg-blue-700"
            >
              <Users className="w-4 h-4 mr-2" />
              Manage Users
            </Link>
            <Link
              to="/admin/manage-properties"
              className="flex items-center px-4 py-2 bg-green-600 text-white rounded-md hover:bg-green-700"
            >
              <Home className="w-4 h-4 mr-2" />
              Manage Properties
            </Link>
          </div>
        </div>

        {/* Stats Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
          <StatCard 
            title="Total Users" 
            value={stats.totalUsers} 
            icon={Users} 
            trend={12.5} 
            trendText="from last month"
            link="/admin/manage-users"
          />
          <StatCard 
            title="Total Properties" 
            value={stats.totalProperties} 
            icon={Home} 
            trend={8.2} 
            trendText="from last month"
            link="/admin/manage-properties"
          />
          <StatCard 
            title="Pending Approvals" 
            value={stats.pendingApprovals} 
            icon={AlertCircle} 
            trend={-3.1} 
            trendText="from last week"
            link="/admin/manage-properties?status=pending"
          />
          <StatCard 
            title="Active Listings" 
            value={stats.activeListings} 
            icon={CheckCircle} 
            trend={5.7} 
            trendText="from last week"
            link="/admin/manage-properties?status=active"
          />
        </div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          {/* Recent Activity */}
          <div className="lg:col-span-2 bg-white rounded-lg shadow p-6">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-lg font-semibold">Recent Activity</h2>
              <Link to="/admin/activity" className="text-sm text-blue-600 hover:underline">
                View all
              </Link>
            </div>
            <div className="space-y-2">
              {recentActivity.map(activity => (
                <ActivityItem key={activity.id} activity={activity} />
              ))}
            </div>
          </div>

          {/* Quick Actions */}
          <div className="bg-white rounded-lg shadow p-6">
            <h2 className="text-lg font-semibold mb-4">Quick Actions</h2>
            <div className="space-y-3">
              <Link
                to="/admin/users/new"
                className="flex items-center p-3 border rounded-md hover:bg-gray-50 transition-colors"
              >
                <Plus className="w-5 h-5 text-green-600 mr-3" />
                <span>Add New User</span>
              </Link>
              <Link
                to="/admin/properties/new"
                className="flex items-center p-3 border rounded-md hover:bg-gray-50 transition-colors"
              >
                <Plus className="w-5 h-5 text-blue-600 mr-3" />
                <span>Add New Property</span>
              </Link>
              <Link
                to="/admin/reports"
                className="flex items-center p-3 border rounded-md hover:bg-gray-50 transition-colors"
              >
                <BarChart2 className="w-5 h-5 text-purple-600 mr-3" />
                <span>View Reports</span>
              </Link>
              <Link
                to="/admin/settings"
                className="flex items-center p-3 border rounded-md hover:bg-gray-50 transition-colors"
              >
                <svg
                  className="w-5 h-5 text-gray-600 mr-3"
                  fill="none"
                  stroke="currentColor"
                  viewBox="0 0 24 24"
                  xmlns="http://www.w3.org/2000/svg"
                >
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M10.325 4.317c.426-1.756 2.924-1.756 3.35 0a1.724 1.724 0 002.573 1.066c1.543-.94 3.31.826 2.37 2.37a1.724 1.724 0 001.065 2.572c1.756.426 1.756 2.924 0 3.35a1.724 1.724 0 00-1.066 2.573c.94 1.543-.826 3.31-2.37 2.37a1.724 1.724 0 00-2.572 1.065c-.426 1.756-2.924 1.756-3.35 0a1.724 1.724 0 00-2.573-1.066c-1.543.94-3.31-.826-2.37-2.37a1.724 1.724 0 00-1.065-2.572c-1.756-.426-1.756-2.924 0-3.35a1.724 1.724 0 001.066-2.573c-.94-1.543.826-3.31 2.37-2.37.996.608 2.296.07 2.572-1.065z"
                  />
                  <path
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    strokeWidth={2}
                    d="M15 12a3 3 0 11-6 0 3 3 0 016 0z"
                  />
                </svg>
                <span>Settings</span>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </Box>
  );
};

export default AdminDashboard;
